import React, { useEffect } from 'react';
import './App.css';
import Papa from  'papaparse';
import UploadFileIcon from '@mui/icons-material/UploadFile';
import {useNavigate} from 'react-router-dom';

function Home({data, setData, loading, setLoading}) {
    const navigate=useNavigate();
const [values,setValues]=React.useState([]);
   const [col,setCol]=React.useState([]);

    function handleChange(event){
      alert('file uploaded!')
      setLoading(true);
      Papa.parse(event.target.files[0],{
        header:true,
        skipEmptyLines:true,
        complete:function(result){
          console.log(result.data)
          setData(result.data);
          setLoading(false);
        }
      })
    }

    function handleClick(){
        navigate('/details')
      }
  return (loading?<h2>Loading...</h2>:
   ( <div className="App">
        <div className="inputDiv">
            <label id="uploadLabel" htmlFor="fileUpload"><UploadFileIcon id="uploadLabelIcon"  />Upload</label>
            <input id="fileInput" type="file" name="file" accept=".csv" onChange={handleChange}/>
        </div>
        <div>
            <button id="generateBtn" onClick={handleClick}>Generate PDF</button>
        </div>
    </div>)
  );
}

export default Home;
